import { React, useState } from 'react'

const Detailed = ({ material }) => {
    const [detailed, setDetailed] = useState([])

    return (
        <div>
            <p>{material.Title}</p>
            <p>{material.Description}</p>
            <p>{material.Usage}</p>
            <p>{material.ThermalConductivity}</p>
            <p>{material.buildings}</p>
        </div>
    )
}

export default Detailed
